import React,{useContext,useState ,useEffect} from 'react'
import { View, Text,  StyleSheet, ScrollView,TouchableOpacity, ImageBackground,Image,Dimensions} from 'react-native';
import Search from './Search';
import {Context as AuthContext} from '../context/AuthContext';
import DateA from './DateA' ;
import Header from './Header';
import Footer from './Footer';
import Menu1 from './Menu1'
import Dashboard from './Dashboard'
import Base from './Base'
import ButtomVoir from './ButtomVoir'
import Rayon from './Rayon'
import {LinearGradient} from 'expo-linear-gradient';

console.disableYellowBox = true;
const menu=(props) =>{
  const [date, setDate] = React.useState({
    picture:require('../images/j1.png'),

  
    
});  
  const {width, height} = Dimensions.get('window')
  const {state,signin} =useContext(AuthContext);
  const [currentDate, setCurrentDate] = useState('');
    const [currentMonth, setCurrentMonth] = useState('');
    useEffect(() => {
        setCurrentDate(
            new Date().getDate()
        );
        setCurrentMonth(
            new Date().getMonth()+1
        );
      
         
          
      }, []);
      const [data, setData] = React.useState({
        
        Rg: state.reponse['data infomation']['j'].Rg,
               dateJ:state.reponse['data infomation']['j'].Date,

        
    });  
    return (

      <View style={{flex:1}}>
<ScrollView  style={styles.container}>
  
  
<Image  source={require('../images/ArruereR.png')} style={styles.action}>
         
         </Image>
         <Header
      onPress={()=>props.navigation.navigate('Dashboard')}
     />
   
           <View style={styles.temView3}>
           <Text style={styles.temText1}>STATION{"\n"}{state.reponse['device infomation'].station}</Text>  
           <Image source={require('../images/Position1.png')} style={styles.Image} />
           </View>
         
    <View style={styles.Cont}>
                    <Text style={styles.Cont1}>{data.dateJ}</Text> 
                    <Image source={require('../images/soleil.png')} style={styles.ImageB} />
<View>
                    <Text style={styles.Cont2}>Rayonnement
                    
                   
                    </Text> 
                     <Text style={styles.Cont3}>J/cm²</Text>
                     </View>
                    </View>
  
    
    <View style={styles.temView2}>
    <View style={styles.temText5}>
        
        <View>
        <View style={{flex: 1}}>
        <Image
         style={{
           alignItems:"center",
           alignContent:"center",
           marginLeft:"5%",

           
         }}
         source={date.picture}
         />
         <View style={{position: 'absolute',marginTop:"9%"}}>
           <TouchableOpacity
                  

             onPress={()=>{setData({
              dateJ:state.reponse['data infomation']['j-1'].Date,

              Rg: state.reponse['data infomation']['j-1'].Rg,


          });setDate({
            picture:require('../images/jm1.png')})}}>
         <DateA date2={(currentDate-1)+'\n'+'0'+currentMonth}  
         />
         </TouchableOpacity>
         </View>
         <View style={{position: 'absolute',marginTop:"70%"}}>
           <TouchableOpacity
            onPress={()=>{setData({
              dateJ:state.reponse['data infomation']['j'].Date,

              Rg: state.reponse['data infomation']['j'].Rg,


          });setDate({picture:require('../images/j1.png')})}}>
         <DateA date2={currentDate+'\n'+'0'+currentMonth}  
         />
         </TouchableOpacity>
         
         </View>
         <View style={{position: 'absolute',marginTop:"130%"}}>
           <TouchableOpacity
            onPress={()=>{setData({
              dateJ:state.reponse['data infomation']['j+1'].Date,
              Rg: state.reponse['data infomation']['j+1'].Rg,


          });setDate({
            picture:require('../images/jm2.png')})}}>
         <DateA date2={(currentDate+1)+'\n'+'0'+currentMonth}   
         />
         </TouchableOpacity  >
         </View>
         <View style={{position: 'absolute',marginTop:"191%"}}>
           <TouchableOpacity  
           onPress={()=>{setData({
            dateJ:state.reponse['data infomation']['j+2'].Date,

            Rg: state.reponse['data infomation']['j+2'].Rg,


          });setDate({
            picture:require('../images/jm3.png')})}}>
         <DateA date2={(currentDate+2)+'\n'+'0'+currentMonth}   
         />
         </TouchableOpacity>
         </View>
        
        

        </View>

        
        </View>
          </View>
<View style={styles.graph}>
<Text style={{fontWeight:'bold',marginLeft:70,fontSize:20,marginBottom:10,color:'tomato'}}>{data.Rg+"J/cm²"}</Text>

        <Rayon dataa={data.Rg ? data.Rg :0}/>
        </View>
        
    </View>
    <View style={styles.temText7}>
      <TouchableOpacity onPress={()=>props.navigation.navigate('RayonnementGraphe')}>
           <LinearGradient
                   colors={['#0B193C', '#0B193C']}
                   style={styles.signIn2}
           >
                    <Text style={styles.textSign}>Voir Plus</Text>
                   
               </LinearGradient>
           </TouchableOpacity>
      
        
      </View>
</ScrollView >
<Footer/>

</View>
    
    );
};
export default menu;
const styles = StyleSheet.create({
    action: {
      height:"53%",
      width:"100%",
    paddingTop:20,
    position:'absolute',
    marginTop:-100
    
    },
    text: {
        
    },
    signIn2: {
      width: 180,
      height: 40,
      justifyContent: 'center',
      alignItems: 'center',
      borderRadius: 14, //50
      flexDirection: 'row',
      
    },
    textSign: {
      color: 'white',
      fontWeight: 'bold',
      fontSize:19
    },
    temView2: {
        flexDirection: 'row',
        marginTop:80
      },
      temT: {
        marginTop:26,
        flexDirection: 'row',
        
      },
      temView3: {
        flexDirection: 'row',
        
      },
      Cont: {
        //alignItems:'center',
        
        backgroundColor: 'white',
        height:110.42,
        width:"90%",
        margin:"5%",
        borderRadius: 9.29,
        marginRight:"5%",
        marginLeft:"5%",
        shadowColor: "#000",
        shadowOffset: {
          width: 0,
          height: 16,
        },
        shadowOpacity: 0.58,
        shadowRadius: 16.00,
        
        elevation: 24,
        flexDirection: 'row',
      },
      
      Cont1:{
       
        marginTop:"12%",
  marginLeft:"6%",
  marginRight:"-2%",
        fontFamily:"Poppins-Regular",
        fontSize:13.93,
        fontWeight:'bold',

        
      
      },
      Cont2:{
      
        marginTop:"26%",
        marginLeft:"5%",
        fontWeight:'bold',
marginRight:12,
        fontFamily:"Poppins-Regular",
        fontSize:13.93,
      },
      Cont3:{
        marginLeft:"30.5%",
        fontWeight:'bold',
        fontFamily:"Poppins-Regular",
        fontSize:18.13 ,
      },
      ImageB:{
        marginLeft:"14%",
        marginTop:"4%",
        marginRight:"4%"
      },
      temText: {
        
        fontSize:17,
        textAlign:"center",
        color:'#FFFFFF',
        marginBottom:10,

      },
      temText4: {
       
        fontSize:17,
        color:'#FFFFFF',
        margin:5,
        marginLeft:20

      },
      
       
        temText1: {
    
          fontSize:30,
          color:'#FFFFFF',
          margin:10,
          marginBottom:0,
          marginLeft:20,
          fontFamily:'OpenSans-Bold',fontWeight:'bold'

      },
      temText5: {   
       marginLeft:10,
       marginRight:10
      },
      graph:{
marginLeft:15,
marginTop:30
      },
      temText6: {   
        marginLeft:10,
        marginTop:40
       
       },
       temText7: {   
        marginLeft:"30%",
        marginTop:"9%"
      
       },
    container: {
        flex:1,  
        backgroundColor:'#fff'
       
    },
    Image:{
      marginLeft:60,
      marginTop:30
     
    },
    temText8: {
       
      fontSize:20,
      color:'#F15C22',
      
     textAlign:'center'

    },
    image1:{
      marginLeft:9,
      marginRight:25
    },
    image2:{
      marginLeft:35,
     
    }
}
);
